<html lang='en'><head etag='2021d0b00334b9d711da2449c013d904'><meta content='Jan Tolenaar (c) 2009-2018' name='copyright'><meta content='text/html; charset=utf-8' http-equiv='Content-Type'><title>help/prototype/keys.mdk</title><link href='../../styles.css?v=601761069' type='text/css' rel='StyleSheet'></head><body><a href='../../index.html' class='banner'>jan&nbsp;tolenaar&nbsp;/&nbsp;<span style='color:yellow'>kiezel</span>lisp</a>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<a href='../../help/index.html' class='banner'>index of everything</a><div id='content'><h2>Name</h2>
<p>prototype:keys</p>
<h2>Usage</h2>
<p>builtin-function</p>
<h2>Syntax</h2>
<p><code>
(<strong>prototype:keys</strong> <em>object</em>)</code><br/></p>
<h2>Description</h2>
<p>Returns a list of strings.</p>
<pre><code>user &gt; (let z (new &quot;name&quot; &quot;Piet&quot;
                   :city &quot;Amsterdam&quot;))
it: z
user &gt; (prototype:keys z)
it: (&quot;name&quot; &quot;city&quot;)
</code></pre>

</div></body></html>
